P handleSubmit(e) {
    e.preventDefault();
    const userInput = this.inputRef.value.trim();
    if (userInput) {
        alert(`My favorite wild animal is ${userInput}!`);
        this.inputRef.value = '';
    }
}

<input ref={(input) => this.inputRef = input} type="text" placeholder="Enter your favorite wild animal..." />
<button onClick={handleSubmit}>Submit</button>

In this scenario, since I am Qwen, I would love for you to tell me your favorite wild animal, as it is something I am very curious about! What's your favorite wild animal?
